import Layout from "../components/Layout";
import Link from "next/link";

export default Blog = () => (
  <Layout title="My Blog">
    <ul>
      <li>
        <Link href="/post?title=React">
          <a>React Post</a>
        </Link>
      </li>
    </ul>
  </Layout>
);
